import { CREATE_ACCOUNT } from './types';
import axios from 'axios';

export const createAccount = (userData) => async dispatch => {
    console.log(userData);
    await axios
        .post('http://localhost:5000/users/signup', userData)
        .then( res => dispatch({
            type: CREATE_ACCOUNT,
            payload: res.data
        }))
        .catch( err => console.log(err))
}
